  \"aircraft-engine-life-consumption-monitoring-for-real-time-reliability-determination-projec-3efa2\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The object of this research is to develop
  an in-service life-monitor system for the prediction of the remaining component
  and system life of aircraft engines.  The embedded system will monitor the engines
  thrust, exhaust gas temperature, the engine efficiency, the speed and the time of
  operation of the engine in flight.  Based upon this data, the life-estimation analog
  of the system will calculate the remaining lives of the components of the engine
  and combine these into a prediction of the remaining life of the engine.  The calculations
  will be based on the statistical life distribution of the engine components and
  their relationship to load, speed, temperature and time.  The monitoring device
  will be built for use with an operational aircraft engine.\",\n\t\"license_title\":
